// Updates informations
var UpdateNotes = "Guide to settings if there is missing parameters and Warn user";

// Var declaration
var ScriptName = GM_info.script.name;
var ScriptVersion = GM_info.script.version;
var segmentcount = 0;
var actionsloaded = 0;
var neededparams = {
    WMESTSCountry: "",
    WMESTSLanguage: "",
    WMESTSChanel: ""
};

// Icons in variables
var iconopacity = "0.7";
var iconheight = "25px";
var Downlockicon = '<img id="slackPermalink" class="Downlock" title="Ask for downlock" style="opacity:' + iconopacity + ';" src="data:image/png;base64," height="' + iconheight + ';"/>';
var Relockicon = '<img id="slackPermalink" class="Lock" title="Ask for lock" style="opacity:' + iconopacity + ';" src="data:image/png;base64," height="' + iconheight + ';"/>';
var closureicon = '<img id="slackPermalink" class="Closure" title="Ask for a closure" style="opacity:' + iconopacity + ';" src="data:image/png;base64," height="' + iconheight + ';"/>';
var openicon = '<img id="slackPermalink" class="Open" title="Ask for openning a segment" style="opacity:' + iconopacity + ';" src="data:image/png;base64," height="' + iconheight + ';"/>';

var validationicon = '<img id="slackPermalink" class="Validation" title="Ask for validation" style="opacity:' + iconopacity + ';" src="data:image/png;base64," height="20px;"/>';
var settingsicon = '<img height="25px;" src="data:image/png;base64," />';

// Initialization
function init(e) {
    log("Load");
    if (typeof W === 'undefined' || typeof W.map === 'undefined' || typeof W.prefs === 'undefined' || typeof W.app.modeController === 'undefined' || document.getElementById('edit-panel') === null) {
        setTimeout(init, 800);
        log("Map is still loading so we'll wait");
        return;
    }
    log('WME charg√©');
    
    // On change, check for changes in the edit-panel
    var WMESTSObserver = new MutationObserver(function(mutations) {
        mutations.forEach(function(mutation) {
            // Mutation is a NodeList and doesn't support forEach like an array
            for (var i = 0; i < mutation.addedNodes.length; i++) {
                var addedNode = mutation.addedNodes[i];

                // Only fire up if it's a node
                if (addedNode.nodeType === Node.ELEMENT_NODE) {
                    var locklevelDiv = addedNode.querySelector('div.form-control.lock-level-selector.waze-radio-container');
                    var closureslistDiv = addedNode.querySelector('div.closures-list');

                    if (locklevelDiv) {
                        log('Lock icons added');
                        $( "#WMESTSlock" ).remove();
                        $('div.form-control.lock-level-selector.waze-radio-container').after('<div id="WMESTSlock">' + Downlockicon + '&nbsp;' + Relockicon + '</div>');
                        $( "#WMESTSvalidation" ).remove();
                        $('div.selection.selection-icon').append('<span id="WMESTSvalidation">' + validationicon + '</div>');
                        log('Validation icon added');
                        Loadactions();
                        CheckNeededParams();
                    }
                    if (closureslistDiv) {
                        log('Closure icons added');
                        $( "#WMESTSclosures" ).remove();
                        if(W.layerSwitcherController.state.attributes.ITEM_CLOSURES === true) {
                            $('.closures-list').before('<div id="WMESTSclosures">' + closureicon + '&nbsp;' + openicon + '</div>');
                        }
                        Loadactions();
                        CheckNeededParams();
                    }
                }
            }
        });
    });
    WMESTSObserver.observe(document.getElementById('edit-panel'), { childList: true, subtree: true });
    setTimeout(VersionCheck(),2000);
    $('#WSTSFS-Container').css('display', 'block');
}

// Functions used by the Script

// Get City ID from Segment/venue ID
function GetCityID(selection, Type) {
    var StreetID = 0;
    if(Type != "segment")
    {
        StreetID = selection.model.attributes.streetID;
    }
    else {
        StreetID = selection.model.attributes.primaryStreetID;
    }
    if(StreetID) {
        return W.model.streets.getObjectById(StreetID).cityID
    } else {
        return 0;
    }
}

// Get City name from City ID
function GetCity(CityId) {
    if(CityId>0) {
       return W.model.cities.getObjectById(CityId).attributes.name;
    }
    else {
        return $('span.full-address').text().split(",")[0];
    }
}

// Get Country name from City ID
function GetCountry(CityId) {
    if(CityId>0) {
       var CountryID = W.model.cities.getObjectById(CityId).attributes.countryID
       return W.model.countries.getObjectById(CountryID).name;
    }
    else {
        return $('span.full-address').text().split(",")[1];
    }
}

// Construction of the request
function Construct(iconaction) {
    var answers = getPermalinkCleaned();
    var permalink = answers[0];
    var textSelection = answers[1];
    var countselected = answers[2];
    var selectedtype = answers[3];
    var RequiredLevel = answers[4];
    var CityName = answers[5];
    var CountryName = answers[6];
    var ShouldbeLockedAt = answers[7];
    var Details = "";
    if(iconaction == "Downlock" || iconaction == "Lock") {
        if(iconaction == "Lock") {
            if(ShouldbeLockedAt == -1) { ShouldbeLockedAt == 1 }
            Details = prompt("To level : ", ShouldbeLockedAt);
        }
        Details = "\r\nInformations : " + Details
    }
    var TextToSend = RequiredLevel + "User : " + W.loginManager.user.userName + " (*L" + W.loginManager.user.normalizedLevel + "*)\r\nrequest type : " + iconaction + "\r\nFor : " + textSelection + "\r\nLocation : " + CityName + ", " + CountryName + Details;
    alert(TextToSend);
}

// Prepare the role of the icons
function Loadactions() {
    if(actionsloaded!=1){
        $(document).on("click", "img#slackPermalink", function () {
            var iconaction = $(this).attr('class');
            log('click on ' + iconaction);
            if(CheckNeededParams()) {
                Construct(iconaction);
            } else {
                $(".slack-settings-tab").click();
                alert('Mising settings, please set all of the following dropdown');
            }
        });
        actionsloaded=1;
    }
    LoadTab();
}

// Recommanded Lock
function getShouldLockedAt(selection, current){
    var ShouldBeLockedAt = current;
    var max_level = 0;
    var seg_rank = 0;
    var CountryLocks = countryDB[localStorage.getItem('WMESTSCountry')]
    var CountryLockLevel = [];
    CountryLockLevel[1] = CountryLocks.str_lvl;
    CountryLockLevel[2] = CountryLocks.pri_lvl;
    CountryLockLevel[3] = CountryLocks.fwy_lvl;
    CountryLockLevel[4] = CountryLocks.rmp_lvl;
    CountryLockLevel[6] = CountryLocks.maj_lvl;
    CountryLockLevel[7] = CountryLocks.min_lvl;
    var RoadType = selection.model.attributes.roadType;
    if(CountryLockLevel[RoadType]) {
        if(CountryLockLevel[RoadType]>ShouldBeLockedAt) {
            ShouldBeLockedAt = CountryLockLevel[RoadType];
        }
    }
    return ShouldBeLockedAt;
}
// Update the language in the Browser's database
function UpdateLanguages() {
    $('#WMESTSLanguage option').each(function() {
        $(this).remove();
    });
    var OptionLanguage = document.createElement('option');
    if(!('WMESTSLanguage' in localStorage)) {
        OptionLanguage.text = "------";
        $('#WMESTSLanguage').append(OptionLanguage)
    }
    var languageselected = languageDB[$('#WMESTSCountry').val()];
    for (var key in languageselected){
        OptionLanguage = document.createElement('option');
        OptionLanguage.text=languageselected[key];
        OptionLanguage.value=key;
        $('#WMESTSLanguage').append(OptionLanguage);
    }
}

// Create Settings Tab
function LoadTab() {
    if(!$('.slack-settings-tab').length){
        var b = $('<li><a class="slack-settings-tab" data-toggle="tab" href="#segment-edit-settings" aria-expanded="false">' + settingsicon + '</a></li>');
        $(".tabs-container ul.nav.nav-tabs").append(b);
        $(".contents .tab-content").append('<div class="tab-pane" id="segment-edit-settings"><div class="settings">Slack</div></div>');
        var countrychoose = document.createElement('select');
        countrychoose.id='WMESTSCountry';
        countrychoose.className='form-control';
        countrychoose.style.margin = '8px 0';
        if(!('WMESTSCountry' in localStorage)) {
            var OptionCountry = document.createElement('option');
            OptionCountry.text="------";
            countrychoose.appendChild(OptionCountry);
        }
        for (var key in countryDB){
            OptionCountry = document.createElement('option');
            OptionCountry.text=countryDB[key].name;
            OptionCountry.value=key;
            if(('WMESTSCountry' in localStorage) && localStorage.getItem('WMESTSCountry') === key) {
               OptionCountry.selected=true;
            }
            countrychoose.appendChild(OptionCountry);
        }
        $("#segment-edit-settings").html('<label class="control-label">Country</label>')
        $("#segment-edit-settings").append(countrychoose);
        $('#WMESTSCountry').change(function() {
            $(localStorage.setItem('WMESTSCountry', $('#WMESTSCountry').val()));
            localStorage.removeItem('WMESTSLanguage');
            localStorage.removeItem('WMESTSChanel');
            UpdateLanguages();
        });
        var languagechoose = document.createElement('select');
        languagechoose.id='WMESTSLanguage';
        languagechoose.className='form-control';
        languagechoose.style.margin = '8px 0';
        if(!('WMESTSLanguage' in localStorage)) {
            var OptionLanguage = document.createElement('option');
            OptionLanguage.text = "------";
            languagechoose.appendChild(OptionLanguage)
        }
        $("#segment-edit-settings").append('<label class="control-label">Channel</label>')
        $("#segment-edit-settings").append(languagechoose);
        $('#WMESTSLanguage').change(function() {
            $(localStorage.setItem('WMESTSLanguage', $('#WMESTSLanguage').val()));
            $(localStorage.setItem('WMESTSChanel', $('#WMESTSCountry').val() + "_" + $('#WMESTSLanguage').val()));
        });
        UpdateLanguages();
    }
}

// Send easily logs into the console
function log(message) { // Thanks to Glodenox but enhanced
  if (typeof message === 'string') {
    console.log('%c' + ScriptName + ' : %c' + message, 'color:black', 'color:#d97e00');
  } else {
    console.log('%c' + ScriptName + ' :', 'color:black', message);
  }
}

// Create the permalink
function getPermalinkCleaned(text) {
    text = "https://www.waze.com/editor?env=row&";
    var count = 0;
    var texttype = "venue";
    var CityName = "";
    var CountryName = "";
    var selectedindex="";
    var selectiontype="&venues=";
    var RequiredRank = 0;
    var ShouldBeLockedAt = -5;
    var projI=new OpenLayers.Projection("EPSG:900913");
    var projE=new OpenLayers.Projection("EPSG:4326");
    var currentlocation = (new OpenLayers.LonLat(W.map.center.lon,W.map.center.lat)).transform(projI,projE).toString().replace(',','&');
    $.each(W.selectionManager.getSelectedFeatures(), function(indx, section){
        if(texttype == "venue") { texttype = section.model.attributes.categories }
        if(selectedindex!="")
        {
            selectedindex=selectedindex + ",";
        }
        selectedindex = selectedindex + section.model.attributes.id;
        if(section.model.type == "camera")
        {
            selectiontype="&cameras=";
            texttype="camera";
        } else if(section.model.type == "bigJunction")
        {
            selectiontype="&bigJunctions=";
            texttype="JB";
        } else if(section.model.type !== 'venue')
        {
            selectiontype="&segments=";
            texttype="segment";
            ShouldBeLockedAt = getShouldLockedAt(section, ShouldBeLockedAt)
        }
        count++;
        if(section.model.attributes.rank > RequiredRank) {
            RequiredRank = section.model.attributes.rank;
        }
        CityName = GetCity(GetCityID(section, texttype));
        CountryName = GetCountry(GetCityID(section, texttype));
    });
    if(ShouldBeLockedAt == -5) { ShouldBeLockedAt = ""; }
    var PL = text + currentlocation + "&zoom=" + W.map.zoom + selectiontype + selectedindex;
    var type = texttype;
    if (count>1) {
        type = count + " " + type + "s";
    } else {
        type = "a " + type
    }
    RequiredRank = ":l" + (RequiredRank + 1) + ": "
    var arr = [PL, type, count, texttype, RequiredRank, CityName, CountryName, ShouldBeLockedAt]
    return arr;
}

// Check the version of the scritpt in the browser to Warn if the script has been updates
function VersionCheck() {
    ///////////////////////////////////////
    //  Verification de la mise √† jour   //
    ///////////////////////////////////////
    if (localStorage.getItem('WMESTSVersion') === ScriptVersion && 'WMESTSVersion' in localStorage) {

    } else if ('WMESTSVersion' in localStorage) {
        if(!WazeWrap.Interface) {
            setTimeout(VersionCheck, 1000);
            log("WazeWrap not ready, waiting");
            return;
        }
        WazeWrap.Interface.ShowScriptUpdate(ScriptName, ScriptVersion, UpdateNotes, "https://gitlab.com/WMEScripts/WME-send-to-slack-public");
        localStorage.setItem('WMESTSVersion', ScriptVersion);
        $(".WWSUFooter a").text("Gitlab")
    }
    else
    {
        localStorage.setItem('WMESTSVersion', ScriptVersion);
    }
}

// Check if the required parameters are Set
function CheckNeededParams() {
    log("Checking the needed parameters");
    var check = 0;
    for (var key in neededparams){
        if(!(key in localStorage)) {
            log(key + ' manquant');
            check = check + 1;
        }
    }
    if ( check == 0 ) {
        return true;
    } else {
        return false;
    }
}
init();